import React from "react";
import Articles from "./Articles";
import SideBar from "./SideBar";

const Main = () => {
    return (
        <section
            id="main-body-section"
            class="main-body-section d-flex p-5 mt-5 mb-5"
        >
            <Articles />
            <SideBar />
        </section>
    );
};

export default Main;
